import React from "react";
import AboutPic from "../../images/portfolio2min.png";
import "./about.css";

const About = () => {
  return (
    <div>
      <div uk-grid>
        <div
          class="uk-child-width-expand@s uk-text-center"
          uk-grid
          uk-height-match="target: > div > .uk-card"
        >
          <div>
            <div class="uk-card uk-card-default uk-card-body">
              <img
                src={AboutPic}
                alt="elizabeth regas"
                className="aboutPic"
              ></img>
            </div>
          </div>
          <div>
            <div class="uk-card uk-card-default uk-card-body">
              <p className="aboutText">Eliza</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default About;
